INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '42', 'au.delà.même.de.la.géolocalisation.le.monde.connecté.à.travers.la.multitude.de.sources.doit.être.pluriel.le.besoin.dadaptation.est.permanent', '{"x":"Au-del\\u00e0 m\\u00eame de la g\\u00e9olocalisation, le monde connect\\u00e9, \\u00e0 travers la multitude de sources, doit \\u00eatre pluriel. Le besoin d\\u2019adaptation est permanent.","en":"Even out of geolocation, the device can be connected from a variety of sources. Equipment is highly adaptive. The characteristics of the product are \\"open\\" and diverse use.","vn":"Ngay c\\u1ea3 khi n\\u1eb1m ngo\\u00e0i v\\u00f9ng \\u0111\\u1ecbnh v\\u1ecb thi\\u1ebft b\\u1ecb v\\u1eabn c\\u00f3 th\\u1ec3 k\\u1ebft n\\u1ed1i \\u0111\\u01b0\\u1ee3c t\\u1eeb nhi\\u1ec1u ngu\\u1ed3n kh\\u00e1c nhau. Thi\\u1ebft b\\u1ecb lu\\u00f4n c\\u00f3 t\\u00ednh th\\u00edch \\u1ee9ng. \\u0110\\u1eb7c \\u0111i\\u1ec3m c\\u1ee7a s\\u1ea3n ph\\u1ea9m l\\u00e0 \\"open\\" v\\u00e0 \\u0111a d\\u1ea1ng s\\u1eed d\\u1ee5ng."}' );
